Por favor, no publique o difunda información que viole las reglas del juego. Los infractores serán tratados con severidad.
El contenido de la violación incluye, pero no se limita a...
1. Información de privacidad personal: como la contraseña de la cuenta, el nombre real, etc.
2. Información inducida: como compras de recargas, descargas de enlaces, etc.
3. Información social: como plataformas sociales, información de contacto, enlaces a sitios web, etc.
4. Contenido que viola las leyes y reglamentos nacionales:
 (1) Violación de los principios básicos establecidos por la Constitución;
 (2) Poner en peligro la seguridad nacional, filtrar secretos de Estado, subvertir el poder del Estado y socavar la unidad nacional;
 (3) Dañar el honor y los intereses nacionales;
 (4) Incitar al odio étnico, la discriminación étnica y socavar la unidad étnica;
 (5) Socavar las políticas religiosas del Estado y promover cultos y supersticiones feudales;
 (6) Difundir rumores, perturbar el orden social y socavar la estabilidad social;
 (7) Difundir la obscenidad, la pornografía, el juego, la violencia, el terror o la instigación al delito;
 (8) Insultar o calumniar a otros, infringir los derechos e intereses legítimos de los demás;
 (9) Incitar a reuniones ilegales, asociaciones, procesiones, manifestaciones, reunir multitudes para alterar el orden social;
 (10) Actuar en nombre de una organización civil ilegal;
 (11) Los que no cumplan con las "Disposiciones provisionales sobre el desarrollo y la gestión de los servicios de información pública para herramientas de mensajería instantánea" y cumplan con los requisitos de las "siete líneas de fondo" de las leyes y reglamentos, el sistema socialista, los intereses nacionales, los intereses legales de los ciudadanos, el orden público, la moralidad social y la autenticidad de la información, etc. ；
 (12) Que contenga otros contenidos prohibidos por las leyes y los reglamentos administrativos.
5. Otros contenidos que no cumplan con las leyes, los reglamentos y los requisitos de la plataforma

#cfa7a0f Sobre la función de gestión de la música #n
-En los juegos en línea, sólo el anfitrión o el servidor tiene la autoridad para ejercer las operaciones de gestión en el reproductor de música, como la pausa, la siguiente canción, la eliminación de la canción, etc;

#cfa7a0f Sobre el contenido musical que puede ser reproducido bajo demanda #n
-Por el momento, sólo se admiten algunas de las canciones autorizadas por QQ Music. Actualmente, nos esforzamos por conseguir más permisos de canciones bajo demanda , así que estate atento;

#cfa7a0f Sobre las restricciones de canciones a la carta en el modo online #n
-La música que ya está en la lista de canciones por reproducir no puede añadirse repetidamente bajo demanda;
-Los no propietarios sólo pueden añadir tres canciones a la lista de espera al mismo tiempo. Una vez alcanzado el límite superior, tienen que esperar a que las canciones que se han pedido terminen o sean eliminadas por el propietario antes de poder volver a pedirlas;

#cfa7a0f Sobre el modo de reproducción de música #n
-Reproducción en cola: Reproducir en el orden de la cola de reproducción, y la canción se eliminará de la cola después de que se haya reproducido.
-Reproducción en bucle: reproduce en el orden de la cola de reproducción, y la canción permanecerá en la lista de espera después de ser reproducida.

#cfa7a0f Acerca de la función de reproducción completa #n
-Cuando está activada, todos los jugadores del juego pueden añadir canciones a la cola de reproducción.
-Cuando está cerrada, sólo el anfitrión o el servidor de la partida pueden añadir canciones a la cola de reproducción.

1. Los aventureros tienen la oportunidad de activar un paquete de regalos sorpresa al completar varias acciones del juego;
2. Cada paquete de regalo de evento activado sólo se puede comprar una vez, y el paquete de regalo desaparece después de completar la compra;
3. Cada paquete de regalo sorpresa tiene un temporizador de cuenta atrás independiente. Después de la cuenta atrás, el paquete de regalo desaparece. ¡No se lo pierdan, todos los aventureros!

1. Para los jugadores que participan en el evento, algunas máscaras de la tienda tendrán ofertas por tiempo limitado; #r
2. Una vez finalizado el evento, la máscara con descuento se restablecerá al precio original, no se pierda la oferta;
3. En el futuro estarán disponibles más bonificaciones emocionantes, ¡así que estad atentos!

El botón de la izquierda está seleccionado: cuando el elemento padre cambia, la distancia entre el elemento hijo y el borde izquierdo del elemento padre no cambia;
-El botón de la derecha está seleccionado: cuando el elemento padre cambia, la distancia entre el elemento hijo y el borde derecho del elemento padre no cambia;
-Se selecciona el botón superior: cuando el elemento padre cambia, la distancia entre el elemento hijo y el borde superior del elemento padre no cambia;
-Se selecciona el botón inferior: cuando el elemento padre cambia, la distancia entre el elemento hijo y el borde inferior del elemento padre no cambia;
-Los botones izquierdo y derecho se seleccionan al mismo tiempo: cuando el elemento padre cambia, la distancia horizontal entre el elemento hijo y el punto central del elemento padre no cambia;
-Los botones arriba y abajo se seleccionan al mismo tiempo: cuando el elemento padre cambia, la distancia vertical entre el elemento hijo y el punto central del elemento padre no cambia;
